import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    
        <nav className="bg-white shadow-md">
                <div className="max-w-7xl mx-auto px-6 py-4 flex justify-between items-center">
                  <div className="flex items-center gap-2">
                    <img src="/train-logo.png" alt="Logo" className="w-8 h-8" />
                    <span className="text-xl font-bold">TrainReservation</span>
                  </div>
                  <div className="space-x-4">
                    <Link to="/" className="text-gray-700 hover:text-blue-600">Home</Link>
                    <Link to="/login" className="text-gray-700 hover:text-blue-600">Login</Link>
                    <Link to="/signup" className="text-gray-700 hover:text-blue-600">Sign Up</Link>
                    <Link to="/reservations" className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">Book Now</Link>
                  </div>
                </div>
              </nav>
  );
};

export default Navbar;
